import React from "react";

function Home() {
    return(
        <>
            <section id="header" className="">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-10 mx-auto">
                            <div className="col-md-6 pt-5"></div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default Home;
